import React, { Component, useState } from 'react';
import {
    SafeAreaView, StyleSheet,
    TextInput,
    View,
    Text,
    Image,
    KeyboardAvoidingView,
    Keyboard,
    TouchableOpacity,
    ScrollView
} from 'react-native';
import AsyncStorage from '@react-native-community/async-storage';
import Axios from 'axios';

export default class Storycreatescreen extends Component {
    constructor(props) {
        super(props)
        this.state = {
            data: [],
            profiles: [],
            testdatas: ''
        }
    }
    getdata = async () => {
        try {
            let users = await AsyncStorage.getItem('userdatas');
            const userdatas = JSON.parse(users);
            console.log(userdatas);
            this.setState({ data: userdatas });
            const gettoken = this.state.data.token;
            const getuserid = this.state.data.userid;
            console.log(gettoken);
            const geturl = 'http://192.168.1.4:8000/api/getuserdetails/';
            const config = {
                headers: {
                    'content-type': 'multipart/form-data',
                    'Authorization': 'Bearer ' + gettoken,
                    'Accept': 'application/json',
                },

            };
            Axios.get(geturl + getuserid, config)
                .then(response => {
                    this.setState({ profiles: response.data.profile });
                    // console.log(response.data.profile.useremail)
                })
                .catch(function (error) {
                    console.log(error);
                })
        } catch (e) {
            // error reading value
            console.log(e);
        }
    }
    componentDidMount() {
        // setTimeout(() => {
        //   this.setState({favoritecolor: "yellow"})
        // alert('hello*********')
        this.getdata();
        // }, 1000)
    }

    render() {
        return (
            <SafeAreaView style={{ flex: 1 }}>
                <TextInput value={this.setState.profiles.username} />
            </SafeAreaView>
        )
    }

}
